    getUserRepos(githubUser) {
        if (this.responses.userRepos.hasOwnProperty(githubUser)) {
            return of(JSON.parse(this.responses.userRepos[githubUser]));
        }
        return throwError(new Error("User not found"));
    }

    getOrgRepos(organization) {
        if (this.responses.orgsRepos.hasOwnProperty(organization)) {
            return of(JSON.parse(this.responses.orgsRepos[organization]));
        }
        return throwError(new Error("Organization not found"));
    }

    getRepoContributors(repoFullname) {
        if (this.responses.repoContribs.hasOwnProperty(repoFullname)) {
            return of(JSON.parse(this.responses.repoContribs[repoFullname]));
        }
    }
